import React from 'react';

const Routine = ({ name, exercises }) => {
  return (
    <div className="routine-card">
      <h2>{name}</h2>
      <ul>
        {exercises.map((exercise, index) => (
          <li key={index}>{exercise}</li>
        ))}
      </ul>
    </div>
  );
};

export default Routine;
